import React from "react";
import ReactDOM from "react-dom";

class Footer extends Component {
  render() {
    return (
      <div className="fixed-bottom">
        <Navbar color="dark" dark>
          <Container>
            <NavbarBrand>Footer</NavbarBrand>
          </Container>
        </Navbar>
      </div>
    );
  }
}

export default Footer;
